  false,\n\t\"url\": null,\n\t\"notes\": \"TThe following is excerpted from the metadata
  document produced by the U.S. Census Bureau for the source shapefile of 2010 voting
  districts in Indiana, named \"tl_2012_18_vtd10.Shp\": \"The TIGER/Line shapefiles
  and related database files (.dbf) are an extract of selected geographic and cartographic
  information from the U.S. Census Bureau's Master Address File / Topologically Integrated
  Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB). The MTDB represents
  a seamless national file with no overlaps or gaps between parts, however, each TIGER/Line
  shapefile is designed to stand alone as an independent data set, or they can be
  combined to cover the entire nation. Voting district is the generic name for geographic
  entities such as precincts, wards, and election districts established by State governments
  for the purpose of conducting elections. States participating in the 2010 Census
  Redistricting Data Program as part of Public Law 94-171 (1975) provided the Census
  Bureau with boundaries, codes, and names for their VTDs. Each VTD is identified
  by a 1- to 6-character alphanumeric census code that is unique within county. For
  the 2010 Census, Rhode Island is the only State that did not participate in Phase
  2 (the Voting District Project) of the Redistricting Data Program and no VTDs exist
  for this State in the 2010 Census data products. Note that only Montana and Oregon
  do not have complete coverage of VTDs for the 2010 Census.\"\",\n\t\"license_title\":
